library(shiny)
library(dplyr)
library(tidyr)
library(ggplot2)
library(plotly)



data_final <- readRDS("data_final.rds")

# Interface do Usuário
ui <- fluidPage(
  titlePanel("Pesquisa de satisfação"),
  
  # Barra de navegação com quatro abas
  navbarPage("Resultados",
             tabPanel("Perguntas gerais",
                      sidebarLayout(
                        sidebarPanel(
                          uiOutput("filters1"),
                          width = 3
                        ),
                        mainPanel(
                          fluidRow(
                            column(
                              width = 12,
                              plotlyOutput("treemap1")
                            )
                          ),
                          fluidRow(
                            column(
                              width = 12,
                              selectInput("pergunta", "Selecione a Pergunta", choices = NULL, selected = NULL)
                            )
                          )
                        )
                      )
             ),
             
             tabPanel("Avaliação dos produtos",
                      sidebarLayout(
                        sidebarPanel(
                          uiOutput("filters2"),
                          width = 3
                        ),
                        mainPanel(
                          fluidRow(
                            column(
                              width = 12,
                              plotlyOutput("treemap2")
                            )
                          ),
                          fluidRow(
                            column(
                              width = 12,
                              selectInput("produto", "Selecione o Produto", choices = NULL, selected = NULL)
                            )
                          )
                        )
                      )
             ),
             
             tabPanel("Avaliação dos dados",
                      sidebarLayout(
                        sidebarPanel(
                          uiOutput("filters3"),
                          width = 3
                        ),
                        mainPanel(
                          fluidRow(
                            column(
                              width = 12,
                              plotlyOutput("treemap3")
                            )
                          ),
                          fluidRow(
                            column(
                              width = 12,
                              selectInput("analista", "Selecione o tipo de dado", choices = NULL, selected = NULL)
                            )
                          )
                        )
                      )
             ),
             
             # Nova página para exibir avaliações de cada analista (graf == 4)
             tabPanel("Avaliação dos Analistas",
                      sidebarLayout(
                        sidebarPanel(
                          uiOutput("filters4"),
                          width = 3
                        ),
                        mainPanel(
                          fluidRow(
                            column(
                              width = 12,
                              tableOutput("table4")
                            )
                          ),
                          fluidRow(
                            column(
                              width = 12,
                              selectInput("analista4", "Selecione o Analista", choices = NULL, selected = NULL)
                            )
                          )
                        )
                      )
             ),
             
             # Nova página para avaliação dos relatórios (graf == 5)
             tabPanel("Avaliação dos Relatórios",
                      sidebarLayout(
                        sidebarPanel(
                          uiOutput("filters5"),
                          width = 3
                        ),
                        mainPanel(
                          fluidRow(
                            column(
                              width = 12,
                              tableOutput("table5")
                            )
                          ),
                          fluidRow(
                            column(
                              width = 12,
                              selectInput("relatorio", "Selecione o Relatório", choices = NULL, selected = NULL)
                            )
                          )
                        )
                      )
             ),
             
             # Nova página para exibir avaliações do gráfico 6
             tabPanel("Dados potenciais",
                      sidebarLayout(
                        sidebarPanel(
                          uiOutput("filters6"),
                          width = 3
                        ),
                        mainPanel(
                          fluidRow(
                            column(
                              width = 12,
                              plotlyOutput("treemap6")
                            )
                          ), fluidRow(
                            column(
                              width = 12,
                              selectInput("relatorio1", "Tipo de dado", choices = NULL, selected = NULL)
                            )
                          )
                        )
                      )
             ),
             
             # Nova página para exibir avaliações do gráfico 7
             tabPanel("Tipo de envio",
                      sidebarLayout(
                        sidebarPanel(
                          uiOutput("filters7"),
                          width = 3
                        ),
                        mainPanel(
                          fluidRow(
                            column(
                              width = 12,
                              plotlyOutput("treemap7")
                            )
                          ),
                          fluidRow(
                            column(
                              width = 12,
                              selectInput("relatorio2", "Forma de envio", choices = NULL, selected = NULL)
                            )
                          )
                        )
                      )
             ),
             tabPanel("Perguntas qualitativas", 
                      sidebarLayout(
                        sidebarPanel(
                          uiOutput("filters8"),
                          width = 3
                        ),
                        mainPanel(
                          fluidRow(
                            column(
                              width = 12,
                              tableOutput("table8")
                            )
                          ),
                          fluidRow(
                            column(
                              width = 12,
                              selectInput("relatorio3", "Selecione a pergunta", choices = NULL, selected = NULL)
                            )
                          )
                        )
                      )
             )
  ),
  
  # Botão para resetar filtros no canto inferior
  absolutePanel(
    bottom = 10, right = 10, width = 200, height = 50,
    actionButton("reset_filters", "Resetar Filtros", style = "padding: 10px; font-size: 16px;")
  ),
  
  # Filtro absoluto para a coluna 'Empresa', visível em todas as páginas
  absolutePanel(
    top = 3, right = 10, width = 250, height = 50,
    selectInput("empresa", "Selecione a Empresa", choices = NULL, selected = NULL)
  )
)

# Lógica do Servidor
server <- function(input, output, session) {
  # Dados simulados
  data <- data_final
  
  # Substituir os NAs na coluna "value"
  data$value[is.na(data$value)] <- "Não Respondido"
  
  # Criar filtros dinâmicos sem incluir "Empresa"
  output$filters1 <- renderUI({
    lapply(names(data), function(col) {
      if (!col %in% c("pergunta", "graf", "value", "Empresa")) {  # Remover 'Empresa' dos filtros
        selectInput(
          inputId = paste0("filter1_", gsub(" ", "_", col)),
          label = col,
          choices = c("Todos", unique(data[[col]])),
          selected = "Todos"
        )
      }
    }) %>% do.call(tagList, .)
  })
  
  output$filters2 <- renderUI({
    lapply(names(data), function(col) {
      if (!col %in% c("pergunta", "graf", "value", "Empresa")) {  # Remover 'Empresa' dos filtros
        selectInput(
          inputId = paste0("filter2_", gsub(" ", "_", col)),
          label = col,
          choices = c("Todos", unique(data[[col]])),
          selected = "Todos"
        )
      }
    }) %>% do.call(tagList, .)
  })
  
  output$filters3 <- renderUI({
    lapply(names(data), function(col) {
      if (!col %in% c("pergunta", "graf", "value", "Empresa")) {  # Remover 'Empresa' dos filtros
        selectInput(
          inputId = paste0("filter3_", gsub(" ", "_", col)),
          label = col,
          choices = c("Todos", unique(data[[col]])),
          selected = "Todos"
        )
      }
    }) %>% do.call(tagList, .)
  })
  
  output$filters4 <- renderUI({
    lapply(names(data), function(col) {
      if (!col %in% c("pergunta", "graf", "value", "Empresa")) {  # Remover 'Empresa' dos filtros
        selectInput(
          inputId = paste0("filter4_", gsub(" ", "_", col)),
          label = col,
          choices = c("Todos", unique(data[[col]])),
          selected = "Todos"
        )
      }
    }) %>% do.call(tagList, .)
  })
  
  output$filters5 <- renderUI({
    lapply(names(data), function(col) {
      if (!col %in% c("pergunta", "graf", "value", "Empresa")) {  # Remover 'Empresa' dos filtros
        selectInput(
          inputId = paste0("filter5_", gsub(" ", "_", col)),
          label = col,
          choices = c("Todos", unique(data[[col]])),
          selected = "Todos"
        )
      }
    }) %>% do.call(tagList, .)
  })
  
  output$filters6 <- renderUI({
    lapply(names(data), function(col) {
      if (!col %in% c("pergunta", "graf", "value", "Empresa")) {  # Remover 'Empresa' dos filtros
        selectInput(
          inputId = paste0("filter6_", gsub(" ", "_", col)),
          label = col,
          choices = c("Todos", unique(data[[col]])),
          selected = "Todos"
        )
      }
    }) %>% do.call(tagList, .)
  })
  
  output$filters7 <- renderUI({
    lapply(names(data), function(col) {
      if (!col %in% c("pergunta", "graf", "value", "Empresa")) {  # Remover 'Empresa' dos filtros
        selectInput(
          inputId = paste0("filter7_", gsub(" ", "_", col)),
          label = col,
          choices = c("Todos", unique(data[[col]])),
          selected = "Todos"
        )
      }
    }) %>% do.call(tagList, .)
  })
  
  output$filters8 <- renderUI({
    lapply(names(data), function(col) {
      if (!col %in% c("pergunta", "graf", "value", "Empresa")) {  # Remover 'Empresa' dos filtros
        selectInput(
          inputId = paste0("filter8_", gsub(" ", "_", col)),
          label = col,
          choices = c("Todos", unique(data[[col]])),
          selected = "Todos"
        )
      }
    }) %>% do.call(tagList, .)
  })
  
  # Atualizar seletores
  observe({
    perguntas_graf1 <- unique(data %>% filter(graf == 1) %>% pull(pergunta))
    updateSelectInput(session, "pergunta", choices = perguntas_graf1, selected = perguntas_graf1[1])
    
    produtos <- unique(data %>% filter(graf == 2) %>% pull(pergunta))
    updateSelectInput(session, "produto", choices = produtos, selected = produtos[1])
    
    analistas <- unique(data %>% filter(graf == 3) %>% pull(pergunta))
    updateSelectInput(session, "analista", choices = analistas, selected = analistas[1])
    
    analistas4 <- unique(data %>% filter(graf == 4) %>% pull(pergunta))
    updateSelectInput(session, "analista4", choices = analistas4, selected = analistas4[1])
    
    # Atualizar seleção para a nova página (graf == 5)
    relatorios5 <- unique(data %>% filter(graf == 5) %>% pull(pergunta))
    updateSelectInput(session, "relatorio", choices = relatorios5, selected = relatorios5[1])
    
    relatorios6 <- unique(data %>% filter(graf == 6) %>% pull(pergunta))
    updateSelectInput(session, "relatorio1", choices = relatorios6, selected = relatorios6[1])
    
    relatorios7 <- unique(data %>% filter(graf == 7) %>% pull(pergunta))
    updateSelectInput(session, "relatorio2", choices = relatorios7, selected = relatorios7[1])
    
    relatorios8 <- unique(data %>% filter(graf == 8) %>% pull(pergunta))
    updateSelectInput(session, "relatorio3", choices = relatorios8, selected = relatorios8[1])
    
    
    
    
    # Atualizar seleção para as novas páginas (graf == 6 e graf == 7)
    updateSelectInput(session, "empresa", choices = unique(data$Empresa), selected = "LCA")
  })
  
  
  
  
  
  ############
  observeEvent(input$empresa, {
    req(input$empresa)
    
    empresa_data <- data %>% filter(Empresa == input$empresa)
    
    # Atualizar os filtros em todas as abas
    lapply(names(data), function(col) {
      if (!col %in% c("pergunta", "graf", "value", "Empresa")) {
        unique_values <- c("Todos", unique(empresa_data[[col]]))
        
        # Atualizar cada seletor de filtro para cada aba
        updateSelectInput(session, paste0("filter1_", gsub(" ", "_", col)), choices = unique_values, selected = "Todos")
        updateSelectInput(session, paste0("filter2_", gsub(" ", "_", col)), choices = unique_values, selected = "Todos")
        updateSelectInput(session, paste0("filter3_", gsub(" ", "_", col)), choices = unique_values, selected = "Todos")
        updateSelectInput(session, paste0("filter4_", gsub(" ", "_", col)), choices = unique_values, selected = "Todos")
        updateSelectInput(session, paste0("filter5_", gsub(" ", "_", col)), choices = unique_values, selected = "Todos")
        updateSelectInput(session, paste0("filter6_", gsub(" ", "_", col)), choices = unique_values, selected = "Todos")
        updateSelectInput(session, paste0("filter7_", gsub(" ", "_", col)), choices = unique_values, selected = "Todos")
        updateSelectInput(session, paste0("filter8_", gsub(" ", "_", col)), choices = unique_values, selected = "Todos")
      }
    })
    
    
    perguntas_graf1 <- unique(empresa_data %>% filter(graf == 1) %>% pull(pergunta))
    updateSelectInput(session, "pergunta", choices = perguntas_graf1, selected = perguntas_graf1[1])
    
    produtos <- unique(empresa_data %>% filter(graf == 2) %>% pull(pergunta))
    updateSelectInput(session, "produto", choices = produtos, selected = produtos[1])
    
    analistas <- unique(empresa_data %>% filter(graf == 3) %>% pull(pergunta))
    updateSelectInput(session, "analista", choices = analistas, selected = analistas[1])
    
    analistas4 <- unique(empresa_data %>% filter(graf == 4) %>% pull(pergunta))
    updateSelectInput(session, "analista4", choices = analistas4, selected = analistas4[1])
    
    # Atualizar seleção para a nova página (graf == 5)
    relatorios5 <- unique(empresa_data %>% filter(graf == 5) %>% pull(pergunta))
    updateSelectInput(session, "relatorio", choices = relatorios5, selected = relatorios5[1])
    
    relatorios6 <- unique(empresa_data %>% filter(graf == 6) %>% pull(pergunta))
    updateSelectInput(session, "relatorio1", choices = relatorios6, selected = relatorios6[1])
    
    relatorios7 <- unique(empresa_data %>% filter(graf == 7) %>% pull(pergunta))
    updateSelectInput(session, "relatorio2", choices = relatorios7, selected = relatorios7[1])
    
    relatorios8 <- unique(empresa_data %>% filter(graf == 8) %>% pull(pergunta))
    updateSelectInput(session, "relatorio3", choices = relatorios8, selected = relatorios8[1])
    
    
  })
  
  
  
  
  
  ########
  
  
  # Criar dados filtrados dinamicamente
  filtered_data1 <- reactive({
    filtered <- data %>% filter(graf == 1)
    for (col in names(data)) {
      selected_value <- input[[paste0("filter1_", gsub(" ", "_", col))]]
      if (!is.null(selected_value) && selected_value != "Todos") {
        filtered <- filtered[filtered[[col]] == selected_value, ]
      }
    }
    if (!is.null(input$pergunta)) {
      filtered <- filtered[filtered$pergunta == input$pergunta, ]
    }
    if (!is.null(input$empresa) && input$empresa != "Todos") {
      filtered <- filtered[filtered$Empresa == input$empresa, ]
    }
    filtered
  })
  
  filtered_data2 <- reactive({
    filtered <- data %>% filter(graf == 2)
    for (col in names(data)) {
      selected_value <- input[[paste0("filter2_", gsub(" ", "_", col))]]
      if (!is.null(selected_value) && selected_value != "Todos") {
        filtered <- filtered[filtered[[col]] == selected_value, ]
      }
    }
    if (!is.null(input$produto)) {
      filtered <- filtered[filtered$pergunta == input$produto, ]
    }
    if (!is.null(input$empresa) && input$empresa != "Todos") {
      filtered <- filtered[filtered$Empresa == input$empresa, ]
    }
    filtered
  })
  
  filtered_data3 <- reactive({
    filtered <- data %>% filter(graf == 3)
    for (col in names(data)) {
      selected_value <- input[[paste0("filter3_", gsub(" ", "_", col))]]
      if (!is.null(selected_value) && selected_value != "Todos") {
        filtered <- filtered[filtered[[col]] == selected_value, ]
      }
    }
    if (!is.null(input$analista)) {
      filtered <- filtered[filtered$pergunta == input$analista, ]
    }
    if (!is.null(input$empresa) && input$empresa != "Todos") {
      filtered <- filtered[filtered$Empresa == input$empresa, ]
    }
    filtered
  })
  
  filtered_data4 <- reactive({
    filtered <- data %>% filter(graf == 4)
    for (col in names(data)) {
      selected_value <- input[[paste0("filter4_", gsub(" ", "_", col))]]
      if (!is.null(selected_value) && selected_value != "Todos") {
        filtered <- filtered[filtered[[col]] == selected_value, ]
      }
    }
    if (!is.null(input$analista4)) {
      filtered <- filtered[filtered$pergunta == input$analista4, ]
    }
    if (!is.null(input$empresa) && input$empresa != "Todos") {
      filtered <- filtered[filtered$Empresa == input$empresa, ]
    }
    filtered
  })
  
  filtered_data5 <- reactive({
    filtered <- data %>% filter(graf == 5)
    for (col in names(data)) {
      selected_value <- input[[paste0("filter5_", gsub(" ", "_", col))]]
      if (!is.null(selected_value) && selected_value != "Todos") {
        filtered <- filtered[filtered[[col]] == selected_value, ]
      }
    }
    if (!is.null(input$relatorio)) {
      filtered <- filtered[filtered$pergunta == input$relatorio, ]
    }
    if (!is.null(input$empresa) && input$empresa != "Todos") {
      filtered <- filtered[filtered$Empresa == input$empresa, ]
    }
    filtered
  })
  
  filtered_data6 <- reactive({
    filtered <- data %>% filter(graf == 6)
    for (col in names(data)) {
      selected_value <- input[[paste0("filter6_", gsub(" ", "_", col))]]
      if (!is.null(selected_value) && selected_value != "Todos") {
        filtered <- filtered[filtered[[col]] == selected_value, ]
      }
    }
    
    if (!is.null(input$relatorio1)) {
      filtered <- filtered[filtered$pergunta == input$relatorio1, ]
    }
    
    
    if (!is.null(input$empresa) && input$empresa != "Todos") {
      filtered <- filtered[filtered$Empresa == input$empresa, ]
    }
    filtered
  })
  
  filtered_data7 <- reactive({
    filtered <- data %>% filter(graf == 7)
    for (col in names(data)) {
      selected_value <- input[[paste0("filter7_", gsub(" ", "_", col))]]
      if (!is.null(selected_value) && selected_value != "Todos") {
        filtered <- filtered[filtered[[col]] == selected_value, ]
      }
    }
    
    
    if (!is.null(input$relatorio2)) {
      filtered <- filtered[filtered$pergunta == input$relatorio2, ]
    }
    
    if (!is.null(input$empresa) && input$empresa != "Todos") {
      filtered <- filtered[filtered$Empresa == input$empresa, ]
    }
    filtered
  })
  
  
  filtered_data8 <- reactive({
    filtered <- data %>% filter(graf == 8)
    for (col in names(data)) {
      selected_value <- input[[paste0("filter8_", gsub(" ", "_", col))]]
      if (!is.null(selected_value) && selected_value != "Todos") {
        filtered <- filtered[filtered[[col]] == selected_value, ]
      }
    }
    
    
    if (!is.null(input$relatorio3)) {
      filtered <- filtered[filtered$pergunta == input$relatorio3, ]
    }
    
    if (!is.null(input$empresa) && input$empresa != "Todos") {
      filtered <- filtered[filtered$Empresa == input$empresa, ]
    }
    filtered
  })
  
  # Renderizar gráficos
  render_treemap <- function(data) {
    req(data)
    freq_data <- data %>% count(value)
    plot_ly(
      type = "treemap",
      labels = freq_data$value,
      parents = rep("", nrow(freq_data)),
      values = freq_data$n,
      textinfo = "label+value+percent entry",
      hoverinfo = "label+value+percent entry"
    )
  }
  
  output$treemap1 <- renderPlotly({ render_treemap(filtered_data1()) })
  output$treemap2 <- renderPlotly({ render_treemap(filtered_data2()) })
  output$treemap3 <- renderPlotly({ render_treemap(filtered_data3()) })
  output$treemap6 <- renderPlotly({ render_treemap(filtered_data6()) })
  output$treemap7 <- renderPlotly({ render_treemap(filtered_data7()) })
  
  # Renderizar tabelas
  output$table4 <- renderTable({
    req(filtered_data4())
    filtered_data4() %>% select(value) %>% rename("Avaliação" = value)
  })
  
  output$table5 <- renderTable({
    req(filtered_data5())
    filtered_data5() %>% select(value) %>% rename("Avaliação" = value)
  })
  
  
  output$table8 <- renderTable({
    req(filtered_data8())
    filtered_data8() %>% select(value) %>% rename("Resposta" = value)
  })
  
  # Resetar filtros
  observeEvent(input$reset_filters, {
    updateSelectInput(session, "empresa", selected = "Todos")
    lapply(names(data), function(col) {
      if (!col %in% c("pergunta", "graf", "value", "Empresa")) {
        updateSelectInput(session, paste0("filter1_", gsub(" ", "_", col)), selected = "Todos")
        updateSelectInput(session, paste0("filter2_", gsub(" ", "_", col)), selected = "Todos")
        updateSelectInput(session, paste0("filter3_", gsub(" ", "_", col)), selected = "Todos")
        updateSelectInput(session, paste0("filter4_", gsub(" ", "_", col)), selected = "Todos")
        updateSelectInput(session, paste0("filter5_", gsub(" ", "_", col)), selected = "Todos")
        updateSelectInput(session, paste0("filter6_", gsub(" ", "_", col)), selected = "Todos")
        updateSelectInput(session, paste0("filter7_", gsub(" ", "_", col)), selected = "Todos")
        updateSelectInput(session, paste0("filter8_", gsub(" ", "_", col)), selected = "Todos")
      }
    })
  })
}


# Rodar o aplicativo Shiny
shinyApp(ui, server)
